var $bm_rt;
var rate, rampDur, freq, decay, w, s, t, s;
rate = 300;
rampDur = $bm_div(value[0], rate);
freq = 3;
decay = 5;
w = $bm_mul($bm_mul(freq, Math.PI), 2);
if (time < $bm_sum(inPoint, rampDur)) {
    s = linear(time, inPoint, $bm_sum(inPoint, rampDur), 0, value[0]);
} else {
    t = $bm_sub(time, $bm_sum(inPoint, rampDur));
    s = $bm_sum(value[0], $bm_div($bm_div($bm_mul(rate, Math.sin($bm_mul(t, w))), Math.exp($bm_mul(t, decay))), w));
}
$bm_rt = [
    s,
    s
];

